import * as o from "react";
import t from "../lib/IconBase.es.js";
import n from "../defs/CrownCross.es.js";
const r = o.forwardRef((s, e) => /* @__PURE__ */ o.createElement(t, { ref: e, ...s, weights: n }));
r.displayName = "CrownCrossIcon";
const c = r;
export {
  c as CrownCross,
  r as CrownCrossIcon
};
